import { Button } from '@mui/material';
import React from 'react'
import Videos from './Videos';
import './Feed.css'
import { useContext } from 'react';
import Authcontext from './AuthContextProvider';
import { Navigate } from 'react-router';
function Feed() {
    const userData = useContext(Authcontext)
    const videos=["http://commondatastorage.googleapis.com/gtv-videos-bucket/sample/ForBiggerBlazes.mp4","http://commondatastorage.googleapis.com/gtv-videos-bucket/sample/ForBiggerEscapes.mp4","http://commondatastorage.googleapis.com/gtv-videos-bucket/sample/ForBiggerFun.mp4"]
    return (
        userData.user ? <div className='flex flex-col w-full h-full justify-center items-center mt-10'>
            <div>
                <Button variant='outlined'>Upload Video</Button>
            </div>
            <div className='flex flex-col justify-between items-center videocontainer'>
                {videos.map(video => {
                    return <Videos videoLink = {video}></Videos>
                })}
            </div>
        </div> : <Navigate to = '/login'></Navigate>
    )
}

export default Feed
